import React from 'react'
import '../CSS/Item.css'
const Item = (props) => {
    return (
        <div className='Item'>
            <img  classNamesrc={props.image} alt="" />
            <p >{props.text}</p>
            <button>Add to Cart</button>
        </div>
    )
}

export default Item
